import React from 'react';


export default function filterRating(props) {
    const filterRating = [];
    for (i = 1; i <= 5; i++) {
        filterRating.push(
            <label className="form-check">
                <input className="form-check-input"
                    type="checkbox"
                    name={i}
                    onChange={props.filterRate}
                />
                <span className="form-check-label">
                    {i} sao
               </span>
            </label>
        )
    }
    return (
        <form>
        { filterRating }
        </form>
    )
}
